CREATE SCHEMA IF NOT EXISTS rumblekongleague;

CREATE TABLE IF NOT EXISTS rumblekongleague.rumblekong_stats (
	token_id	TEXT,
	shooting	INTEGER,
	finish	INTEGER,
	defense	INTEGER,
	vision	INTEGER,
	total_boost	INTEGER,
	rank_by_boost INTEGER
);


CREATE INDEX IF NOT EXISTS rumblekong_stats_idx ON rumblekongleague.rumblekong_stats USING BRIN (token_id);